import React from "react";

const WeatherIcon = props => (
  <>
    {props.icon}

    {(props.icon.props.description === "few clouds" ||
      "scattered clouds" ||
      "broken clouds") &
    (props.condition === "partly cloudy") ? (
      <input type="checkbox" checked />
    ) : (
      <input type="checkbox" />
    )}
  </>
);

export default WeatherIcon;
